func minGroupsForValidAssignment(nums []int) int {
    count := make(map[int]int)
    for _, num := range nums {
        count[num]++
    }

    maxCount := 0
    for _, c := range count {
        if c > maxCount {
            maxCount = c
        }
    }

    groups := 0
    for maxCount > 0 {
        groups++
        for k := range count {
            if count[k] > 0 {
                count[k]--
                maxCount = max(maxCount, count[k])
            }
        }
    }

    return groups
}

func max(a, b int) int {
    if a > b {
        return a
    }
    return b
}
